'''Nan Smithson''' was the daughter of [[Smith Smithson]], the title character of the story ''[[Smith of Wootton Major]]'', and [[Nell Smithson]].  When she grew up and married, she moved to [[Wootton Minor]] and had a son named [[Tom (son of Nan)|Tom]].<ref>[[J.R.R. Tolkien]], ''[[Smith of Wootton Major]]''</ref>

